string complexNumberMultiply(string a, string b) {
        string result = "" ;
        int a1 = realpart(a) ;
        int a2 = realpart(b) ;
        int b1 = complex(a) ;
        int b2 = complex(b) ;
        
        result = result + to_string(a1*a2-b1*b2)+'+'+to_string(a1*b2+a2*b1)+'i' ;
        
        return result ;
    }

